INSERT INTO `wp_posts` VALUES (1,1,'2020-08-20 01:31:05','2020-08-20 01:31:05','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world-redirected','','','2020-10-09 17:25:18','2020-10-09 17:25:18','',0,'http://localhost:8080/?p=1',0,'post','',1),(2,1,'2020-08-20 01:31:05','2020-08-20 01:31:05','<!-- wp:paragraph -->\n<p>This is an example page.</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2020-09-24 08:34:06','2020-09-24 08:34:06','',0,'http://localhost:8080/?page_id=2',0,'page','',0),(3,1,'2020-08-20 01:31:05','2020-08-20 01:31:05','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://localhost:8080.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2020-08-20 01:31:05','2020-08-20 01:31:05','',0,'http://localhost:8080/?page_id=3',0,'page','',0),(4,1,'2020-08-20 01:31:20','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2020-08-20 01:31:20','0000-00-00 00:00:00','',0,'http://localhost:8080/?p=4',0,'post','',0),(7,1,'2020-09-23 13:13:23','2020-09-23 13:13:23','<!-- wp:paragraph -->\n<p>The content of this post was modified.</p>\n<!-- /wp:paragraph -->','Hello world! (edited)','','inherit','closed','closed','','1-autosave-v1','','','2020-09-23 13:13:23','2020-09-23 13:13:23','',1,'http://localhost:8080/1-autosave-v1/',0,'revision','',0),(9,1,'2020-09-23 13:39:56','0000-00-00 00:00:00','<!-- wp:paragraph -->\n<p>This page is just a draft and it should not be publicly accessible.</p>\n<!-- /wp:paragraph -->','This is a page draft','','draft','closed','closed','','','','','2020-09-23 13:39:56','2020-09-23 13:39:56','',0,'http://localhost:8080/?page_id=9',0,'page','',0),(10,1,'2020-09-23 13:39:48','2020-09-23 13:39:48','<!-- wp:paragraph -->\n<p>This page is just a draft and it should not be publicly accessible.</p>\n<!-- /wp:paragraph -->','This is a page draft','','inherit','closed','closed','','9-revision-v1','','','2020-09-23 13:39:48','2020-09-23 13:39:48','',9,'http://localhost:8080/9-revision-v1/',0,'revision','',0),(11,1,'2020-09-23 13:42:00','2020-09-23 13:42:00','<!-- wp:paragraph -->\n<p>This is an example page.</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2020-09-23 13:42:00','2020-09-23 13:42:00','',2,'http://localhost:8080/2-revision-v1/',0,'revision','',0),(13,1,'2020-09-24 08:22:49','2020-09-24 08:22:49','<!-- wp:paragraph -->